// LoadUser loads the aiInterpretation's User into the .R struct
func (o *AiInterpretation) LoadUser(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if o == nil {
		return nil
	}

	// Reset the relationship
	o.R.User = nil

	related, err := o.User(mods...).One(ctx, exec)
	if err != nil {
		return err
	}

	related.R.AiInterpretations = AiInterpretationSlice{o}

	o.R.User = related
	return nil
}

// LoadUser loads the aiInterpretation's User into the .R struct
func (os AiInterpretationSlice) LoadUser(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if len(os) == 0 {
		return nil
	}

	users, err := os.User(mods...).All(ctx, exec)
	if err != nil {
		return err
	}

	for _, o := range os {
		if o == nil {
			continue
		}

		for _, rel := range users {

			if !(o.UserID == rel.ID) {
				continue
			}

			rel.R.AiInterpretations = append(rel.R.AiInterpretations, o)

			o.R.User = rel
			break
		}
	}

	return nil
}

// LoadTasks loads the aiInterpretation's Tasks into the .R struct
func (o *AiInterpretation) LoadTasks(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if o == nil {
		return nil
	}

	// Reset the relationship
	o.R.Tasks = nil

	related, err := o.Tasks(mods...).All(ctx, exec)
	if err != nil {
		return err
	}

	for _, rel := range related {
		rel.R.AiInterpretation = o
	}

	o.R.Tasks = related
	return nil
}

// LoadTasks loads the aiInterpretation's Tasks into the .R struct
func (os AiInterpretationSlice) LoadTasks(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if len(os) == 0 {
		return nil
	}

	tasks, err := os.Tasks(mods...).All(ctx, exec)
	if err != nil {
		return err
	}

	for _, o := range os {
		if o == nil {
			continue
		}

		o.R.Tasks = nil
	}

	for _, o := range os {
		if o == nil {
			continue
		}

		for _, rel := range tasks {

			if !rel.AiInterpretationID.IsValue() {
				continue
			}
			if !(rel.AiInterpretationID.IsValue() && o.ID == rel.AiInterpretationID.MustGet()) {
				continue
			}

			rel.R.AiInterpretation = o

			o.R.Tasks = append(o.R.Tasks, rel)
		}
	}

	return nil
}

type aiInterpretationJoins[Q dialect.Joinable] struct {
	typ   string
	User  modAs[Q, userColumns]
	Tasks modAs[Q, taskColumns]
}

func (j aiInterpretationJoins[Q]) aliasedAs(alias string) aiInterpretationJoins[Q] {
	return buildAiInterpretationJoins[Q](buildAiInterpretationColumns(alias), j.typ)
}

func buildAiInterpretationJoins[Q dialect.Joinable](cols aiInterpretationColumns, typ string) aiInterpretationJoins[Q] {
	return aiInterpretationJoins[Q]{
		typ: typ,
		User: modAs[Q, userColumns]{
			c: Users.Columns,
			f: func(to userColumns) bob.Mod[Q] {
				mods := make(mods.QueryMods[Q], 0, 1)

				{
					mods = append(mods, dialect.Join[Q](typ, Users.Name().As(to.Alias())).On(
						to.ID.EQ(cols.UserID),
					))
				}

				return mods
			},
		},
		Tasks: modAs[Q, taskColumns]{
			c: Tasks.Columns,
			f: func(to taskColumns) bob.Mod[Q] {
				mods := make(mods.QueryMods[Q], 0, 1)

				{
					mods = append(mods, dialect.Join[Q](typ, Tasks.Name().As(to.Alias())).On(
						to.AiInterpretationID.EQ(cols.ID),
					))
				}

				return mods
			},
		},
	}
}
